import React from 'react';
import { Container, FormGroup, Input, Label } from 'reactstrap';

const InventoryVisibility = () => {
  return (
    <Container>
      <h4 className='pt-4 pb-5'>Inventory Visibility</h4>
      <div className='d-flex w-100 h-100'>
        <div className='w-25 h-100' style={{ backgroundColor: 'gray' }}>
          <div className='d-flex w-100 justify-content-center'>
            <h6>Category</h6>
          </div>
          <div>
            <FormGroup check>
              <Label check>
                <Input type='checkbox' /> Mattress
              </Label>
            </FormGroup>
          </div>
        </div>
        <div
          className='d-flex w-75 h-100 ml-1'
          style={{ backgroundColor: 'blue' }}></div>
      </div>
    </Container>
  );
};

export default InventoryVisibility;
